import Layout from '../components/Layout';


const About = () =>  (
    <Layout>
         <div className="row">
            <div className="container">
                <h1>About Me</h1>
            
                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer at vestibulum purus, eget posuere enim. Fusce gravida leo dolor. Nunc imperdiet tortor mi, quis vestibulum massa pellentesque quis. Aenean sit amet ex vel lorem sodales convallis. Praesent mi diam, tempor gravida commodo at, interdum sit amet sapien. Pellentesque tincidunt purus enim, id tincidunt magna scelerisque sagittis. Pellentesque et arcu luctus, vulputate orci a, ultricies nibh.<br/><br/>
